import React, {Component} from "react";


class Navbar extends Component {


    constructor(props) {
        super(props);
        this.state = {
            loginedUser: false

        };
    }






    render() {
        return (
            <nav className="navbar navbar-light bg-light">
                <span className="navbar-brand mb-0 h1">Navbar</span>
            </nav>
        );
    }

}

export default Navbar;
